    false,nt"url": null,nt"notes": "In response to concerns regarding the conservation
    and management of wetland biodiversity within the Lahontan Valley, The Nature Conservancy,
    in cooperation with the U.S. Fish and Wildlife Service, initiated a study in May
    1993 to inventory and classify the Lahontan Valley wetland vegetation. The primary
    objectives of the study were to: (1) identify and describe wetland plant associations
    that occur in the Lahontan Valley; (2) identify the relationships between wetland
    plant associations and environmental conditions; and (3) identify the range of wetland
    plant associations and environmental conditions that occur within wetland management
    areas, and compare them to those that occur outside the managed areas. Additionally,
    the results of this study could be used to validate and update the National Wetlands
    Inventory National List of Plant Species that occur in Wetlands for the Intermountain
    Region.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
